import React from 'react';
import couple1 from '../images/couple.jpg';
import grossesse1 from '../images/grossesse.jpg';

const data = [
	{
		id: 1,
		picture: couple1,
		category: 'couple'
	},
	{
		id: 2,
		picture: './images/grossesse.jpg',
		category: 'pregnancy'
	}
];

const Galery = () => {
	return (
		<div>
			<div className="gallery">
				{data.map((photo, index) => (
					<div className="picContainer" key={index}>
						<img src={photo.picture} alt={photo.category} />
					</div>
				))}
			</div>
		</div>
	)
}

export default Galery
